import React from 'react';

class List extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <Router>
        <Switch>
            <Route exact path='/catalog'
              render={routerProps => <Catalog {...routerProps} />}
            />
            <Route path='/catalog/:id'
              render={routerProps => <CatalogItem {...routerProps} />}
            />
        </Switch>
      </Router>
    );
  }
}

export default List;
